(3, 'HASIL SPRING POLE  MIKO MALL 12MARET2017', '<p>*RICARDO`S BRILLA LOLLITA SHELBY* 30PTS\r\n\r\nJuara1 sp small miko mall 12maret2017\r\n</p><p>\r\n*RICARDO`S BATSHEBA MILLY MOOR* 20PTS\r\n\r\nJuara 2 sp small miko mall 12maret2017\r\n</p><p>\r\n*PITS KUBANGAN SAMMY* 10PTS\r\n\r\nJuara 3 sp small miko mall 12maret2017\r\n</p><p>\r\n*INNOCENTI`S DON KING* 30PTS\r\n\r\nJuara 1 sp medium miko mall 12maret2017\r\n</p><p>\r\n*CHICKO VON PARADISE* 20PTS\r\n\r\nJuara 2 sp medium miko mall 12maret2017\r\n</p><p>\r\n*RICARDO`S CND SHINOBI ATHENA THE FIGHTER* 10PTS\r\n\r\nJuara 3 sp medium miko mall 12maret2017\r\n</p><p>\r\n*RICARDO`S BOURBON TIM TIMEBOMB* 30PTS\r\n\r\nJuara 1 sp large miko mall 12maret2017\r\n</p><p>\r\n*EL SANTOS* 20PTS\r\n\r\nJuara 2 sp large miko mall 12maret2017\r\n</p><p>\r\n*GALAND VON REVOLUSIONER* 10pts\r\n\r\nJuara 3 sp large miko mall 12maret2017</p>', '2017-04-28 02:08:36', '2017-04-28 02:08:36'),
(4, 'RULE WEIGHT PULLING', '<p>1. Kelas yang dipertandingkan adalah sebagai berikut\r\n    -Kelas S berat 16-22kg\r\n    -Kelas M berat 22.02-28kg\r\n    -Kelas L berat 28.01 up\r\n</p><p>2. Semua anjing pitbull yang ikut kompetisi wajib teregistrasi ICR.\r\n</p><p>3. Anjing pitbull yang mengikuti kompetisi harus dalam keadaan sehat. Team panitia berhak membatalkan ke ikut serta an anjing pitbull yang akan mengikuti kompetisi bila dianggap tidak sehat (misal anjing lesu, sakit kulit, cedera luka)\r\n</p><p>4. Anjing betina yang sedang mengalami masa subur (loops) / mengandung / menyusui DILARANG memasuki arena pertandingan dan DILARANG ikut bertanding.\r\n</p><p>5. DILARANG menggunakan bait berupa binatang hidup dan makanan.\r\n6. </p>', '2017-04-28 04:22:09', '2017-04-28 04:22:09'),
(6, 'ATURAN PENDAFTARAN ICR', '<p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">ATURAN PENDAFTARAN ICR</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">1. Setiap anjing pitbull yang sudah di registrasi ICR hanya memiliki 1nomer mikrochip yang disuntikan di bagian pundak pitbull nya dan nomer mikrochip tersebut harus sama dengan yang tertera di stambum ICR dengan dilengkapi pula foto pitbull yang bersangkutan. BILAMANA ADA yang terdapat 2nomor mikrochip berbeda yang tertanam di bodi anjing maka yang berlaku adalah yang tertera di data ICR PUSAT. (MOHON DI KONFIRMASI KE ICR PUSAT)</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">2. Pemacakan pitbull yang sudah ter registrasi ICR minimal umur 1tahun (12bulan) untuk pitbull jantan dan pitbull betina.</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">3. Pihak ICR berhak untuk menolak registrasi pembuatan stambum apabila anjing pitbull nya tidak sesuai dengan kriteria standarisasi ICR.</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">4. Untuk pembuatan ulang stambum ICR dikarenakan hilang atau rusak atau perubahan nama pemilik atau pembaharuan foto (foto waktu masih puppy ingin pembaharuan ke foto anjing dewasa. NB anjing pitbull nya harus sama) dikenakan biaya Rp 125.000 (seratus dua puluh lima ribu rupiah).</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">5. Data yang berlaku adalah yang tertera di data base pusat dan tidak bisa diganggu gugat. </p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">6. Untuk update data bisa konfirmasi ke email icr_indonesia@yahoo.com</p><p rgb(100,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" background-color:=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" rgb(249,=\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\">7. PEMACAKAN YANG TIDAK DIPERBOLEHKAN ADALAH BAPAK X ANAK DAN IBU X ANAK. </p>', '2017-10-05 18:44:48', '2017-10-05 18:44:48');
